import React from "react";
import {StyleSheet, TextInput} from "react-native"

const styles = StyleSheet.create({
    container: {
    
    backgroundColor:"#0000ae",
    position:'absolute',
    alignItems:'center',

    top:0,
    bottom:0,
    left:0,
    right:0,
    },

    iconLogo:{
        width:300,
        height:150,
        resizeMode:"contain",
        marginBottom:80,

    },

    wrapLogin:{
        width:"80%",
        borderRadius:7,
        marginLeft:"10%",
        marginRight:"10%",
        padding:7,
        minHeight:300,
    },
    infoUser:{
        marginBottom:7,
        color:"white"
    },
    containerInput:{

        borderBottomWidth:1,
        borderRightWidth:0,
        marginBottom:40,
        backgroundColor:"#e1e1e1",
        padding:10,
        borderRadius:7
    },
    input:{
        fontSize:14,
        marginLeft:2,
        borderRadius:7,
        color:"#525252",

    },
    button:{
        borderRadius:7,
        marginTop:100,
        marginBottom:30,
        padding:20,
        alignItems:'center',
        backgroundColor:'#ffffff',
        borderWidth:StyleSheet.hairlineWidth,
        borderColor:"#21d4fd",
        
    },
    textButton:{
            
        color:"#4040ff",
        fontSize:15
    }
  });

  export default styles
